	justify-content: center;
	will-change: transform;
	position: absolute;
	right: 0;
	top: 10%;
	bottom: 10%;
	margin-right: 1.25%;
}

.loadingCog:active,
.loadingCog,
.loadingCog:focus {
	outline: none;
	box-shadow: none;
}

.loadingCog:hover {
	cursor: default !important;
}
